css:
@-moz-document domain(songmeanings.com)
{



div,div *,html,body,td,span,li,p,font,blockquote,dd,h1,h2,h3,h4,h5,h6
{
  text-shadow: none !important;
  color: #f0f0f0 !important;
  background-color: #272727 !important;
}

div.main-holder {
  background: #272727;
}

a:link {color: #f94 !important}
a:visited {color: #a73 !important} 
a:hover, a:active {color: #8F006A !important}

input {
   border-color: #2E8B57 !important;
}



}
